import logo from './logo.svg';
import './App.css';
import AccountTransactionManagement from "./Components/AccountTransactionManagement";
import CreditCardApplication from "./Components/CreditCardApplication";
import Homepage from "./Components/Homepage";
import Index from "./Components/index";
import LoanApplication from "./Components/LoanApplication"; 
import ProductExploration from "./Components/ProductExploration";
import ProfilePage from "./Components/ProfilePage";
import TransactionManagement from "./Components/TransactionManagement";
import UserProfile from "./Components/UserProfile";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>

      <Homepage />
      <AccountManager />
      <CreditCardApplication />
      <LoanApplication />
      <ProductExploration />
      <ProfilePage />
      <AccountTransactionManagement />
      <UserProfile />
      <Index />
    </div>
  );
}

export default App;
